import React from 'react';
import './App.css';

function Helloworld (props) {
  return (
    <div id="hello">
      <h3>{props.subtitle}</h3>
      {props.mytext}</div>
  )
}

function App() {
  return (
    <div>
      This is my component:
      <Helloworld mytext="Hello mate 1" subtitle="cosa"/>
      <Helloworld mytext="Hello mate 2"/>
      <Helloworld mytext="Hello mate 3"/></div>
  );
}

export default App;
